// SPDX-License-Identifier: MIT
pragma solidity 0.8.12;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

contract Reward is Ownable {
    IERC20 public token;
    address public oracle;
    mapping(address => uint256) public rewardAccumulationMap;

    constructor(IERC20 _token, address _oracle) {
        require(address(_token) != address(0), "Invalid token address");
        require(address(_oracle) != address(0), "Invalid oracle address");
        token = _token;
        oracle = _oracle;
    }

    function setOracle(address _oracle) public onlyOwner {
        require(address(_oracle) != address(0), "Invalid address");
        oracle = _oracle;
    }

    function reward(uint256 _amount, address _receiver) public {
        require(_msgSender() == oracle, "Invalid sender address");
        uint256 rewardAmount = _amount - rewardAccumulationMap[_receiver];
        require(rewardAmount > 0, "Invalid reward amount");
        token.approve(address(this), rewardAmount);
        token.transferFrom(address(this), _receiver, rewardAmount);
        rewardAccumulationMap[_receiver] += rewardAmount;
    }
}
